import React from "react";
import "./styles/Footer.scss";

const Footer = () => {
  return (
    <footer className="flex justify-between items-center bg-gray-900 text-white p-4">
      {/* Left: API Name */}
      <div className="text-lg font-bold">PushNotify API</div>

      {/* Middle: Quick Links */}
      <div className="flex gap-4">
        <a href="/docs" className="hover:underline">Docs</a>
        <a href="/pricing" className="hover:underline">Pricing</a>
        <a href="/support" className="hover:underline">Support</a>
      </div>

      {/* Right: Social Media Links */}
      <div className="flex gap-4">
        <a href="https://github.com/SudoRV" target="_blank" rel="noopener noreferrer">GitHub</a>
        <a href="https://youtube.com" target="_blank" rel="noopener noreferrer">YouTube</a>
        <a href="mailto:your-email@example.com">Email</a>
      </div>
    </footer>
  );
};

export default Footer;
